import React from 'react';
import styled from 'styled-components';

const Navigation = styled.nav`
	display: flex;
	list-style-type: none;
	font-size: 1.5rem;
	justify-content: space-between;
	align-items: center;
`;

function Nav() {
	return (
		<Navigation>
			<ul>
				<li>Home</li>
				<li>My Dashboard</li>
				<li>My Community</li>
				<li>Guides</li>
			</ul>
		</Navigation>
	);
}

export default Nav;
